cy.api({
  method: "POST",
  url: url,
  body: payload
}).then(r => {
  const viagem = r.body.match(/<status_viagem>([\s\S]*?)<\/status_viagem>/)[1].trim();
  const latitude = r.body.match(/<origem_latitude>([\s\S]*?)<\/origem_latitude>/)[1].trim();
  const longitude = r.body.match(/<origem_longitude>([\s\S]*?)<\/origem_longitude>/)[1].trim();
  expect(r.status).to.eq(200);
  expect(viagem).to.be.oneOf(["agendado", "Cancelado"]);
  expect(latitude).to.exist;
  expect(latitude).to.not.be.empty;
  expect(longitude).to.exist;
  expect(longitude).to.not.be.empty;
});
